/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "unity-basics"
    }}>{`Unity Basics`}</h1>
    {
      /* TOC */
    }
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#unity-basics"
        }}>{`Unity Basics`}</a>{` - `}<a parentName="li" {...{
          "href": "#overview"
        }}>{`Overview`}</a>{` - `}<a parentName="li" {...{
          "href": "#scene-view---navigation-and-positioning"
        }}>{`Scene View - Navigation and Positioning`}</a>{` - `}<a parentName="li" {...{
          "href": "#scene-view-controls"
        }}>{`Scene View Controls`}</a>{` - `}<a parentName="li" {...{
          "href": "#the-game-view"
        }}>{`The Game View`}</a>{` - `}<a parentName="li" {...{
          "href": "#the-toolbar"
        }}>{`The Toolbar`}</a></li>
    </ul>
    {
      /* /TOC */
    }
    <p>{`The initial `}<inlineCode parentName="p">{`default layout`}</inlineCode>{` is the initial arrangement. You can change the layout on the top right.`}</p>
    <h3 {...{
      "id": "overview"
    }}>{`Overview`}</h3>
    <p>{`The hierarchy is on the left side of the screen. It's the list of objects in the scene.`}</p>
    <p>{`The bottom part is full of the assets.`}</p>
    <p>{`The main screen has the `}<inlineCode parentName="p">{`scene`}</inlineCode>{` and `}<inlineCode parentName="p">{`game`}</inlineCode>{` views that allow you to see different perspectives.`}</p>
    <p>{`There are also a number of different preset values that you can use as well.`}</p>
    <p>{`You can also use the tab and drag to rearrange the view.`}</p>
    <h3 {...{
      "id": "scene-view---navigation-and-positioning"
    }}>{`Scene View - Navigation and Positioning`}</h3>
    <p>{`A quick navigation is to right click and use the arrows to move around. You can also use the mouse to change the direction of view.`}</p>
    <p><inlineCode parentName="p">{`F`}</inlineCode>{` key after selecting an object will focus in on the object.`}</p>
    <p>{`You can orbit by holding `}<inlineCode parentName="p">{`alt`}</inlineCode>{` and dragging.`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Position Tools`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Q: Pan`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`W: Move`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`E: Rotate`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`R: Scale`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "scene-view-controls"
    }}>{`Scene View Controls`}</h3>
    <p>{`The `}<inlineCode parentName="p">{`scene gizmo`}</inlineCode>{` is the viewing angle at the top right.`}</p>
    <p>{`The `}<inlineCode parentName="p">{`shaded`}</inlineCode>{` dropdown is to switch between different dropdowns.`}</p>
    <p>{`The lighting is good for checking scenes that are or are not dark.`}</p>
    <p>{`You can use the gizmos dropdown to switch between gizmos.`}</p>
    <p>{`You can use the search box in order to find elements quickly.`}</p>
    <h3 {...{
      "id": "the-game-view"
    }}>{`The Game View`}</h3>
    <p>{`The game view will show what the game will look like at the end.`}</p>
    <p>{`You can select 2 by 3 to see a view of everything.`}</p>
    <h3 {...{
      "id": "the-toolbar"
    }}>{`The Toolbar`}</h3>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
